def time_collector():    
    time_dictionary = {}
    for lists in strings:
        start_time_d = time.time()
        lcs_dynamic(string1=lists[0], string2=lists[1], show=False)
        end_time_d = time.time()
        total_time_d = end_time_d - start_time_d
        
        start_time_dac = time.time()
        lcs_divide_conquer(s1=lists[0], s2=lists[1], show_dac=False)
        end_time_dac = time.time()
        total_time_dac = end_time_dac - start_time_dac

        key = str(len(lists[0]))
        time_dictionary.update({key: {'d': total_time_d, 'dac': total_time_dac}})

    x = list(time_dictionary.keys())    
    y_d = [time_dictionary[key]['d'] for key in x]
    y_dac = [time_dictionary[key]['dac'] for key in x]

    plt.plot(x, y_d, label='Dynamic')
    plt.plot(x, y_dac, label='Divide and Conquer')
    plt.xlabel('Cantidad de caracteres')
    plt.ylabel('Tiempo (s)')

    plt.legend()
    plt.show()


if __name__ == '__main__':
    time_collector()